import React from "react";

import { EuiCard, EuiFlexItem } from "@elastic/eui";

const Card = (props) => (
  <EuiFlexItem>
    <EuiCard
      style={{ width: "18rem" }}
      textAlign="left"
      image={
        <div>
          <img src={props.item.media.standard[0].url} alt="" />
        </div>
      }
      title={props.item.name}
      description={props.item.price.offer_price.value}
    />
  </EuiFlexItem>
);

export default Card;
